  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p><em parentName="p">{`自 v2.3.0 起可用`}</em></p>
    <p>{`Rancher 包含一些实验性功能，默认状态下，这些功能是禁用的。在某些情况下，您可能想要启用这些功能。例如，如果您决定使用的`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/feature-flags/enable-not-default-storage-drivers/_index"
      }}>{`Rancher 技术支持团队不支持的存储类型`}</a>{`所带来的好处大于风险，则可能需要启用这些未被测试过的功能。功能开关，使您可以尝试使用默认情况下未启用的功能。`}</p>
    <p>{`可以通过三种方式启用这些功能：`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#%E5%90%AF%E5%8A%A8-rancher-%E6%97%B6%E5%90%AF%E7%94%A8%E5%8A%9F%E8%83%BD"
        }}>{`启动 Rancher 时启用功能`}</a>{` 使用 CLI 安装 Rancher 时，可以使用功能开关默认启用这些功能。`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#%E9%80%9A%E8%BF%87-rancher-ui-%E5%90%AF%E7%94%A8%E5%8A%9F%E8%83%BD"
        }}>{`在 Rancher UI 中启用功能`}</a>{` 在 Rancher v2.3.3+进入`}<strong parentName="li">{`设置`}</strong>{`页面。`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#%E9%80%9A%E8%BF%87-rancher-api-%E5%90%AF%E7%94%A8%E5%8A%9F%E8%83%BD"
        }}>{`通过 Rancher API 启用功能`}</a>{` 安装 Rancher 之后。`}</li>
    </ul>
    <p>{`每个功能有两个值：`}</p>
    <ul>
      <li parentName="ul">{`默认值，可以通过命令行配置一个标志或环境变量`}</li>
      <li parentName="ul">{`设置值，可以通过 Rancher API 或 UI 配置`}</li>
    </ul>
    <p>{`如果未设置任何值，则 Rancher 使用默认值`}</p>
    <p>{`因为 API 设置了实际值，而命令行设置了默认值，所以这意味着，如果您使用 API 或 UI 启用或禁用功能，它将覆盖命令行设置的值。`}</p>
    <p>{`例如，如果您安装 Rancher，然后使用 Rancher API 将功能开关设置为 true，然后通过命令行将功能开关设置为 false 来升级 Rancher，默认值仍然是 false，但是这个功能还是被启用的，因为它是通过 Rancher API 设置的。如果随后使用 Rancher API 删除了设置值（true），并将其设置为 NULL，则默认值（false）将生效。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意：`}</strong>{` 从 v2.4.0 开始，有些功能开关可能需要重新启动 Rancher Server 容器。下表和 UI 中标记了哪些功能需要重新启动 Rancher Server。`}</p>
    </blockquote>
    <p>{`以下是 Rancher 中可用的功能开关的列表：`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`dashboard`}</inlineCode>{`：此功能将启用下一代的实验性 UI。仪表板还使用了 Rancher 中的新 API，该 API 允许 UI 访问默认的 Kubernetes 资源，而不经过 Rancher 的任何干预。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`unsupported-storage-drivers`}</inlineCode>{`: 启用`}<a parentName="li" {...{
          "href": "/docs/rancher2/installation/options/feature-flags/enable-not-default-storage-drivers/_index"
        }}>{`允许不受支持的存储驱动程序`}</a>{`。换句话说，它启用了默认情况下未启用的 storage providers 和 provisioners 的类型。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`proxy`}</inlineCode>{`：此功能使 Rancher 使用新的简化的代理模块，这有助于增强性能和安全性。但是目前有一个已知问题，新的代理功能会导致 Helm 不能正常工作，这会导致包括 Rancher 工具（如监控，日志，Istio 等）在内的任何应用商店应用部署失败。`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`istio-virtual-service-ui`}</inlineCode>{`：启用 Istio 的流量管理功能：`}<a parentName="li" {...{
          "href": "/docs/rancher2/installation/options/feature-flags/istio-virtual-service-ui/_index"
        }}>{`通过 UI 创建，读取，更新和删除 Istio 虚拟服务和目标规则`}</a>{`。`}</li>
    </ul>
    <p>{`下表显示了在 Rancher 中功能开关的可用版本和默认值：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`功能开关名`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`默认值`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`状态`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`可用版本`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`是否需要重启 Rancher?`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`dashboard`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`true`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`实验性`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.4.0`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`是`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`istio-virtual-service-ui`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`false`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`实验性`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.3.0`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`istio-virtual-service-ui`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`true`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`GA`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.3.2`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`proxy`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`false`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`实验性`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.4.0`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`unsupported-storage-drivers`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`false`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`实验性`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.3.0`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "启动-rancher-时启用功能"
    }}>{`启动 Rancher 时启用功能`}</h2>
    <p>{`安装 Rancher 时，请使用功能开关启用所需的功能。该命令会有所不同，具体取决于您是高可用安装还是单节点安装。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意：`}</strong>{` 通过 Rancher API 设置的值将覆盖通过命令行传递的值。`}</p>
    </blockquote>
    <h3 {...{
      "id": "高可用安装"
    }}>{`高可用安装`}</h3>
    <p>{`当通过 Helm chart 安装 Rancher 时，请使用`}<inlineCode parentName="p">{`--features`}</inlineCode>{`选项。在下面的示例中，通过传递功能开关名称（用逗号分隔）来启用两个功能：`}</p>
    <pre><code parentName="pre" {...{}}>{`helm install rancher-latest/rancher \\
  --name rancher \\
  --namespace cattle-system \\
  --set hostname=rancher.my.org \\
  --set 'extraEnv[0].name=CATTLE_FEATURES' # 自 v2.3.0 起可用
  --set 'extraEnv[0].value=<FEATURE-FLAG-NAME-1>=true,<FEATURE-FLAG-NAME-2>=true' # 自 v2.3.0 起可用
`}</code></pre>
    <p>{`注意：如果要安装 Alpha 版本，Helm 要求在命令中添加`}<inlineCode parentName="p">{`--devel`}</inlineCode>{`参数。`}</p>
    <h4 {...{
      "id": "在离线安装时渲染-helm-chart"
    }}>{`在离线安装时渲染 Helm Chart`}</h4>
    <p>{`对于离线安装 Rancher，通过 Helm 安装 Rancher 之前，需要添加一个 Helm chart 仓库，渲染一个 Helm 模板。有关详细信息，请参阅`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/other-installation-methods/air-gap/install-rancher/_index"
      }}>{`离线安装文档。`}</a></p>
    <p>{`在下面的示例中，通过传递功能开关名称（用逗号分隔）来启用两个功能。`}</p>
    <p>{`Helm 3 命令如下：`}</p>
    <pre><code parentName="pre" {...{}}>{`helm template rancher ./rancher-<VERSION>.tgz --output-dir . \\
  --namespace cattle-system \\
  --set hostname=<RANCHER.YOURDOMAIN.COM> \\
  --set rancherImage=<REGISTRY.YOURDOMAIN.COM:PORT>/rancher/rancher \\
  --set ingress.tls.source=secret \\
  --set systemDefaultRegistry=<REGISTRY.YOURDOMAIN.COM:PORT> \\ # 自 v2.2.0 起可用，配置 Rancher 使用默认的镜像仓库
  --set useBundledSystemChart=true # 自 v2.3.0 起可用，使用Rancher内嵌的system charts
  --set 'extraEnv[0].name=CATTLE_FEATURES' # 自 v2.3.0 起可用
  --set 'extraEnv[0].value=<FEATURE-FLAG-NAME-1>=true,<FEATURE-FLAG-NAME-2>=true' # 自 v2.3.0 起可用
`}</code></pre>
    <p>{`Helm 2 命令如下：`}</p>
    <pre><code parentName="pre" {...{}}>{`helm template ./rancher-<VERSION>.tgz --output-dir . \\
  --name rancher \\
  --namespace cattle-system \\
  --set hostname=<RANCHER.YOURDOMAIN.COM> \\
  --set rancherImage=<REGISTRY.YOURDOMAIN.COM:PORT>/rancher/rancher \\
  --set ingress.tls.source=secret \\
  --set systemDefaultRegistry=<REGISTRY.YOURDOMAIN.COM:PORT> \\ # 自 v2.2.0 起可用，配置 Rancher 使用默认的镜像仓库
  --set useBundledSystemChart=true # 自 v2.3.0 起可用，使用Rancher内嵌的system charts
  --set 'extraEnv[0].name=CATTLE_FEATURES' # 自 v2.3.0 起可用
  --set 'extraEnv[0].value=<FEATURE-FLAG-NAME-1>=true,<FEATURE-FLAG-NAME-2>=true' # 自 v2.3.0 起可用
`}</code></pre>
    <h3 {...{
      "id": "单节点安装"
    }}>{`单节点安装`}</h3>
    <p>{`通过 Docker 安装 Rancher 时，请使用`}<inlineCode parentName="p">{`--features`}</inlineCode>{`选项。在下面的示例中，通过传递功能开关名称（逗号分隔）来启用两个功能：`}</p>
    <pre><code parentName="pre" {...{}}>{`docker run -d -p 80:80 -p 443:443 \\
  --restart=unless-stopped \\
  rancher/rancher:rancher-latest \\
  --features=<FEATURE-FLAG-NAME-1>=true,<FEATURE-NAME-2>=true # 自 v2.3.0 起可用
`}</code></pre>
    <h2 {...{
      "id": "通过-rancher-ui-启用功能"
    }}>{`通过 Rancher UI 启用功能`}</h2>
    <p><em parentName="p">{`自 v2.3.3 起可用`}</em></p>
    <ol>
      <li parentName="ol">{`转到`}<strong parentName="li">{`全局`}</strong>{`视图，然后单击`}<strong parentName="li">{`系统设置`}</strong></li>
      <li parentName="ol">{`单击`}<strong parentName="li">{`功能选项`}</strong>{`选项卡。您将看到一个实验功能列表。`}</li>
      <li parentName="ol">{`要启用功能，请转到要启用的禁用功能，然后单击 `}<strong parentName="li">{`省略号 (...) > 启用`}</strong>{`。`}</li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong>{` 该功能已启用。`}</p>
    <h2 {...{
      "id": "通过-rancher-ui-禁用功能"
    }}>{`通过 Rancher UI 禁用功能`}</h2>
    <p><em parentName="p">{`自 v2.3.3 起可用`}</em></p>
    <ol>
      <li parentName="ol">{`转到`}<strong parentName="li">{`全局`}</strong>{`视图，然后单击`}<strong parentName="li">{`系统设置`}</strong></li>
      <li parentName="ol">{`单击`}<strong parentName="li">{`功能选项`}</strong>{`选项卡。您将看到一个实验功能列表。`}</li>
      <li parentName="ol">{`要启用功能，请转到要启用的禁用功能，然后单击 `}<strong parentName="li">{`省略号 (...) > 停用`}</strong>{`。`}</li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong>{` 该功能被禁用。`}</p>
    <h2 {...{
      "id": "通过-rancher-api-启用功能"
    }}>{`通过 Rancher API 启用功能`}</h2>
    <ol>
      <li parentName="ol">{`转到 `}<inlineCode parentName="li">{`<RANCHER-SERVER-URL>/v3/features`}</inlineCode>{`.`}</li>
      <li parentName="ol">{`在`}<inlineCode parentName="li">{`data`}</inlineCode>{`部分，您将会看到一个包含所有可以使用功能开关启用功能的功能数组。功能名称在`}<inlineCode parentName="li">{`id`}</inlineCode>{`字段中。单击要启用的功能的名称。`}</li>
      <li parentName="ol">{`在屏幕左上角，`}<strong parentName="li">{`Operations`}</strong>{`下面，单击`}<strong parentName="li">{`Edit`}</strong>{`.`}</li>
      <li parentName="ol">{`在 `}<strong parentName="li">{`Value`}</strong>{` 下拉菜单, 单击 `}<strong parentName="li">{`True`}</strong>{`。`}</li>
      <li parentName="ol">{`单击 `}<strong parentName="li">{`Show Request`}</strong>{`。`}</li>
      <li parentName="ol">{`单击 `}<strong parentName="li">{`Send Request`}</strong>{`。`}</li>
      <li parentName="ol">{`单击 `}<strong parentName="li">{`Close`}</strong>{`。`}</li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong>{` 该功能已启用。`}</p>
    <h2 {...{
      "id": "通过-rancher-api-禁用功能"
    }}>{`通过 Rancher API 禁用功能`}</h2>
    <ol>
      <li parentName="ol">{`转到 `}<inlineCode parentName="li">{`<RANCHER-SERVER-URL>/v3/features`}</inlineCode>{`。`}</li>
      <li parentName="ol">{`在 `}<inlineCode parentName="li">{`data`}</inlineCode>{` 部分, 您将会看到一个包含所有可以使用功能开关启用功能的功能数组。功能名称在`}<inlineCode parentName="li">{`id`}</inlineCode>{`字段中。单击要启用的功能的名称。`}</li>
      <li parentName="ol">{`在屏幕左上角， `}<strong parentName="li">{`Operations`}</strong>{` 下面， 单击`}<strong parentName="li">{`Edit`}</strong>{`。`}</li>
      <li parentName="ol">{`在 `}<strong parentName="li">{`Value`}</strong>{` 下拉菜单, 单击 `}<strong parentName="li">{`False`}</strong>{`。`}</li>
      <li parentName="ol">{`单击 `}<strong parentName="li">{`Show Request`}</strong>{`。`}</li>
      <li parentName="ol">{`单击 `}<strong parentName="li">{`Send Request`}</strong>{`。`}</li>
      <li parentName="ol">{`单击 `}<strong parentName="li">{`Close`}</strong>{`。`}</li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong>{` 该功能被禁用。`}</p>
    </MDXLayout>;
}

